import React from 'react';
import "./Sculpture.css";
import Gallerynav from './gallerynav';

import scul1 from '../img/scul1.jpg';
import scul2 from '../img/scul2.jpg';
import scul3 from '../img/scul3.jpg';
import scul4 from '../img/scul4.jpg';
import scul5 from '../img/scul5.jpg';
import scul6 from '../img/scul6.jpg';
import scul7 from '../img/scul7.jpg';
import scul8 from '../img/scul8.jpg';

const onesculp = <img src={scul1} width='200' height='200'/>;
const twosculp = <img src={scul2} width='200' height='200'/>;
const threesculp = <img src={scul3} width='200' height='200'/>;
const foursculp = <img src={scul4} width='200' height='200'/>;

const Sculpture = () =>{
    return (
        <div>
            <Gallerynav />
            {/*<button type="button" class="btn" onclick = {()=>{}}>⚙</button>*/}
        <div class="grid-container">
        <div class="grid-item"><img src={scul1} width='200' height='200'/>
        <div className = "re">
            [조각1]<br/>
            [2000-00-00] 
            </div>
                    
        </div>
        <div class="grid-item"><img src={scul2} width='200' height='200'/></div>
        <div class="grid-item"><img src={scul3} width='200' height='200'/></div>
        <div class="grid-item"><img src={scul4} width='200' height='200'/></div>
        <div class="grid-item"><img src={scul5} width='200' height='200'/></div>
        <div class="grid-item"><img src={scul6} width='200' height='200'/></div>
        <div class="grid-item"><img src={scul7} width='200' height='200'/></div>
        <div class="grid-item">
            <img src={scul8} width='200' height='200'/>
            <div className = "re">
            [조각8]<br/>
            [2000-00-00] 
            </div>
        </div>
        </div>
        </div>

        
        
        
    );
    
}

export {onesculp,twosculp,threesculp,foursculp};

export default Sculpture;
